  return (
    <div className="note">
      <h1>{props.title}</h1>
      !paragraphIsClicked<p onClick={Expand} rows="1">{props.content}</p>
      <button onClick={handleClick}>
        <DeleteIcon/>        
      </button>
    </div>
  );
}

